CREATE SCHEMA IF NOT EXISTS examples;

-- examples.observations definition

-- Drop table

-- DROP TABLE examples.observations;

CREATE TABLE examples.observations (
	gid serial NOT NULL,
	datetime varchar(50) NULL,
	speedmetersperhour float8 NULL,
	s1temperaturecelsius float8 NULL,
	decibeldb float8 NULL,
	pmconcentrationpm100 float8 NULL,
	pmconcentrationpm10 float8 NULL,
	pmconcentrationpm25 float8 NULL,
	pmcountgreater03umnan float8 NULL,
	pmcountgreater05umnan float8 NULL,
	pmcountgreater100umnan float8 NULL,
	pmcountgreater10umnan float8 NULL,
	pmcountgreater25umnan float8 NULL,
	pmcountgreater50umnan float8 NULL,
	s2temperaturecelsius float8 NULL,
	co2concentrationppm float8 NULL,
	humidityrh float8 NULL,
	s3temperaturecelsius float8 NULL,
	mrt float8 NULL,
	utci float8 NULL,
	fid varchar(50) NULL,
	the_geom geometry NULL,
	CONSTRAINT addr_pkey PRIMARY KEY (gid),
	CONSTRAINT enforce_geotype_the_geom CHECK (((geometrytype(the_geom) = 'POINT'::text) OR (the_geom IS NULL)))
);
CREATE INDEX observations_the_geom_gist ON examples.observations USING gist (the_geom);


